import React from 'react';

import Cards from 'react-credit-cards';
import 'react-credit-cards/es/styles-compiled.css'

const CbUser = () => {
    return (
        <div className="BlockContainer">
            <div className="TitleBackground">
                <h4 className='h4'>CbUser</h4>
            </div>
            <div className="BlockCbUser">
                <ReactCardPayment {...{
                    labelCardNumber: "Card number",
                    labelMonth: "Month",
                    labelYear: "Year",
                    labelCardHolder: "Cardholder name",
                    button: "Pay",
                    placeholderCardnumber: "0000 0000 0000 0000",
                    placeholderMonth: "00",
                    placeholderYear: "00",
                    placeholderCardHolder: "JOHN DOE",
                    placeholderCvv: "000"
                }} onSubmit={alert('it was submitted')}/>
            </div>
        </div>
    )
}

export default CbUser;
